using Fibonacci.Calculators;

namespace Fibonacci.Tests
{
    public class FibonacciTests
    {
        [Theory]
        [InlineData(0, "0")]
        [InlineData(1, "1")]
        [InlineData(2, "1")]
        [InlineData(3, "2")]
        [InlineData(6, "8")]
        [InlineData(15, "610")]
        [InlineData(74, "1304969544928657")]
        [InlineData(92, "7540113804746346429")]
        [InlineData(100, "354224848179261915075")]
        [InlineData(186, "332825110087067562321196029789634457848")]
        public void Test_UInt128_WithYield(uint index, string expectedResult)
        {
            UInt128 result = UintYieldLoopFibonacciCalculator.GetValue(index);
            _ = UInt128.TryParse(expectedResult, out UInt128 expected);
            Assert.Equal(expected, result);
        }

        [Fact]
        public void Test_UInt128_ShouldFailed()
        {
            UInt128 result = UintYieldLoopFibonacciCalculator.GetValue(187);
            string expectedResult = "538522340430300790495419781092981030533";

            bool tryParseResult = UInt128.TryParse(expectedResult, out _);

            Assert.False(tryParseResult);
            Assert.NotEqual(expectedResult, result.ToString());
        }


